import { getImageUrl } from "./utils";

function Avatar({ person, size }) {
  return (
    <img
      className="avatar"
      src={getImageUrl(person)}
      alt={person.name}
      width={size}
      height={size}
    />
  );
}

function About({Role}){
    return(
        <div>
            <ul>
                <li>
                    {Role.Profession}
                </li>
            </ul>
        </div>
    );
}


export default function Profiles() {
  return (
    <div>
        <About
            Role={{
                Profession: "physicist and chemist",
                Awards: "4",
                Discovered: "polonium"
            }}
        />


      <Avatar
        size={100}
        person={{
          name: 'Katsuko Saruhashi',
          imageId: 'YfeOqp2'
        }}
      />
      <Avatar
        size={80}
        person={{
          name: 'Aklilu Lemma',
          imageId: 'OKS67lh'
        }}
      />
      <Avatar
        size={50}
        person={{
          name: "Lin Lanying",
          imageId: '1bX5QH6'
        }}
      />
    </div>
  );
}
